import React from 'react';
import "./FrontBody.css"
import { Link } from 'react-router-dom';
import Aboutus from '../../ABOUT US/Aboutus';

const linkstyle={
  textDecoration:"none",
  cursor:"pointer"
}  
const NavBar = () => {
  return <div>
    <header>
      {/* <Aboutus/> */}
    <div className='logo'>
        <img src="/images/chef-icon.png" width={100} alt="chef illustration"/>
    </div>
    <ul  className='header-menu'>
      <Link to="/" style={linkstyle}> <li className='li'>Home</li></Link>
<li className='li' >      <Link to="/menu" >Menu</Link></li>
        <li className='li'>About</li>
    </ul>
    <div className='icon'>
      <input type="text"  placeholder='Search' name='search' id="search"/>
     <label for="search"> <img src='/images/search-icon.svg'/></label>
      <img src='/images/menu-icon.svg'/>
    </div>
    </header>  
  </div>;
};

export default NavBar;
